import os
import base64
import time
bmap = """"""
ls = [0, 143560, 288512, 422876, 564204, 707764, 851880, 979000, 1019184] #B, C, Clos, Def, I, P, S fin, s sta
keys = [b'QmVubmV0', b'Q2F0cmlu', b'SW5nbw==', b'UGhpbGlwcA=='] #B, C, I, P
for key in range(len(keys)):
    keys[key] = base64.b64decode(keys[key]).decode("ascii")
    keys[key] = keys[key].lower()
    
class plsndException(Exception):
    pass
    
def _plsndWin(sound, block = True):
    
    from ctypes import c_buffer, windll
    from random import random
    from time   import sleep
    from sys    import getfilesystemencoding
    
    def winCommand(*command):
        buf = c_buffer(255)
        command = ' '.join(command).encode(getfilesystemencoding())
        errorCode = int(windll.winmm.mciSendStringA(command, buf, 254, 0))
        if errorCode:
            errorBuffer = c_buffer(255)
            windll.winmm.mciGetErrorStringA(errorCode, errorBuffer, 254)
            exceptionMessage = ('\n    Error ' + str(errorCode) + ' for command:'
                                '\n        ' + command.decode() +
                                '\n    ' + errorBuffer.value.decode())
            raise plsndException(exceptionMessage)
        return buf.value
    
    alias = 'plsnd_' + str(random())
    winCommand('open "' + sound + '" alias', alias)
    winCommand('set', alias, 'time format milliseconds')
    durationInMS = winCommand('status', alias, 'length')
    winCommand('play', alias, 'from 0 to', durationInMS.decode())
    
    if block:
        sleep(float(durationInMS) / 1000.0)

def _plsndOSX(sound, block = True):
    
    from AppKit     import NSSound
    from Foundation import NSURL
    from time       import sleep
    
    if '://' not in sound:
        if not sound.startswith('/'):
            from os import getcwd
            sound = getcwd() + '/' + sound
        sound = 'file://' + sound
    url   = NSURL.URLWithString_(sound)
    nssound = NSSound.alloc().initWithContentsOfURL_byReference_(url, True)
    if not nssound:
        raise IOError('Unable to load sound named: ' + sound)
    nssound.play()
    
    if block:
        sleep(nssound.duration())

def _plsndNix(sound, block=True):
    
    if not block:
        raise NotImplementedError(
            "block=False cannot be used on this platform yet")
    
    import os
    try:
        from urllib.request import pathname2url
    except ImportError:
        # python 2
        from urllib import pathname2url
    
    import gi
    gi.require_version('Gst', '1.0')
    from gi.repository import Gst
    
    Gst.init(None)
    
    playbin = Gst.ElementFactory.make('playbin', 'playbin')
    if sound.startswith(('http://', 'https://')):
        playbin.props.uri = sound
    else:
        playbin.props.uri = 'file://' + pathname2url(os.path.abspath(sound))
    
    set_result = playbin.set_state(Gst.State.PLAYING)
    if set_result != Gst.StateChangeReturn.ASYNC:
        raise plsndException(
            "playbin.set_state returned " + repr(set_result))
    
    bus = playbin.get_bus()
    bus.poll(Gst.MessageType.EOS, Gst.CLOCK_TIME_NONE)
    playbin.set_state(Gst.State.NULL)


from platform import system
system = system()

if system == 'Windows':
    plsnd = _plsndWin
elif system == 'Darwin':
    plsnd = _plsndOSX
else:
    plsnd = _plsndNix

del system





def plnw(number, blk=True):
    if (number == 0):
        key = os.getlogin().lower()
        trc = 3
        for n in range(len(keys)):
            if ((key.find(keys[n]) != -1) or (keys[n].find(key) != -1)):
                if (n == 0):
                    trc = 0
                elif (n == 1):
                    trc = 1
                elif (n == 2):
                    trc = 4
                elif (n == 3):
                    trc = 5
                break
                
    elif (number == 1):
        trc = 7
    elif (number == 2):
        trc = 6
    elif (number == 3):
        trc = 2
    
        
    tr = bmap[ls[trc]:ls[trc+1]].encode("utf-8")
    byt = base64.b64decode(tr)
    
    open(str(trc) + "temp.mp3", "wb").write(byt)
    plsnd(str(trc) + "temp.mp3", blk)
    
    
    
    
    
    
    




